import React,{ Component } from "react";
export default class Pagination extends Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <article>
                <Pagination config = {{
                    totalPage:10,
                }}></Pagination>
            </article>
        );
    }
}
